import React from 'react';
import AppointmentList from '../components/AppointmentList';
import AppointmentForm from '../components/AppointmentForm';

const Dashboard = () => {
    return (
        <div>
            <h1>Appointment Dashboard</h1>
            <AppointmentForm />
            <AppointmentList />
        </div>
    );
};

export default Dashboard;
